import "./App.css";

// Custom components
import AddMedication from "./Components/AddMedication.js";
import AddReminder1 from "./Components/AddReminder1.js";
import DisplayMedications from "./Components/DisplayMedications.js";
import Login from "./Components/Login.js";
import MedicationConfirmation from "./Components/MedicationConfirmation.js";
import MenuAppBar from "./Components/MenuAppBar.js";
import Nav from "./Components/Nav.js";

import {BrowserRouter, Route, Routes} from "react-router-dom";

export default function App() {
    return (
        <BrowserRouter>
            <div className="App">
                <Routes>
                    <Route exact path="/" element={
                        <div className="Login">
                            <Login/>
                        </div>
                    }/>

                    <Route exact path="/add-medication" element={
                        <div>
                            <MenuAppBar/>
                            <div className="Container">
                                <AddMedication/>
                            </div>
                        </div>
                    }/>

                    <Route exact path="/add-reminder" element={
                        <div>
                            <MenuAppBar/>
                            <div className="Container">
                                <AddReminder1/>
                            </div>
                        </div>
                    }/>

                    <Route path="/add-reminder/user" element={
                        <div>
                            <MenuAppBar/>
                            <div className="Container">
                                <AddReminder1/>
                            </div>
                        </div>
                    }/>

                    <Route path="/confirmation" element={
                        <div>
                            <MenuAppBar/>
                            <div className="Container">
                                <MedicationConfirmation/>
                            </div>
                        </div>
                    }/>

                    <Route exact path="/main-menu" element={
                        <div>
                            <MenuAppBar/>
                            <div className="Container">
                                <Nav/>
                            </div>
                        </div>
                    }/>

                    <Route exact path="/medications" element={
                        <div>
                            <MenuAppBar/>
                            <div className="Container">
                                <DisplayMedications/>
                            </div>
                        </div>
                    }/>
                </Routes>

            </div>
        </BrowserRouter>
    );
}
